import React, { useEffect } from "react";
import { AiOutlineArrowsAlt } from "react-icons/ai";
import Aos from "aos";
import "aos/dist/aos.css";

const Dashboard = () => {
  useEffect(() => {
    Aos.init({ duration: 1000 });
  }, []);

  function expandTodo() {
    console.log("Navigate to Todo page");
  }
  function expandTask() {
    console.log("Navigate to Task page");
  }
  function expandNote() {
    console.log("Navigate to Notes page");
  }

  return (
    <div className="home-body-conatiner" data-aos="zoom-in">
      <header id="dash-header" className="search-bar">
        <h1>Dashboard</h1>
      </header>
      <main className="body-content">
        {/* Notes Section */}
        <div className="notes" data-aos="fade-up-right">
          <div className="con-head">
            <p>Notes</p>
            <button onClick={expandNote} id="all">
              <AiOutlineArrowsAlt size={18} />
            </button>
          </div>
          <div className="content-section">
            <p>Note Content Placeholder</p>
          </div>
        </div>
        {/* Todo Section */}
        <div className="todos" data-aos="fade-up-left">
          <div className="con-head">
            <p>Todo's</p>
            <button onClick={expandTodo} id="all">
              <AiOutlineArrowsAlt size={18} />
            </button>
          </div>
          <div className="content-section">
            <p>Todo Content Placeholder</p>
          </div>
        </div>
        {/* Tasks Section */}
        <div className="stats" data-aos="fade-up-right">
          <div className="con-head">
            <p>Tasks</p>
            <button onClick={expandTask} id="all">
              <AiOutlineArrowsAlt size={18} />
            </button>
          </div>
          <div className="content-section">
            <p>Task Content Placeholder</p>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
